import React from "react";
import { useParams } from 'react-router-dom';

const Dentist = () => {
  const { id } = useParams(); 

  return (
    <div>
      <h2>Detail Dentista</h2>
      <table>
        <thead>
          <tr>
            <th>Name</th>
            <th>Email</th>
            <th>Phone</th>
            <th>Website</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <td>{Dentist.name}</td>
            <td>{Dentist.email}</td>
            <td>{Dentist.phone}</td>
            <td>{dentist.website}</td>
          </tr>
        </tbody>
      </table>
    </div>
  );
};

export default Dentist;
